import React from "react";
import "./style.css";
import Map from "./map_placeholder.png"

function Jumbotron() {
  return (
    <div className="jumbotron">
      <img src={Map} alt="map_placeholder" style={{position: "relative"}}/>
      <div className="dropdown"> Select A Park 
      <div class="btn-group">
  <button type="button" class="btn btn-danger">Action</button>
  <button type="button" class="btn btn-danger dropdown-toggle dropdown-toggle-split" data-toggle="dropdown" aria-expanded="false">
    <span class="sr-only">Toggle Dropdown</span>
  </button>
  <div class="dropdown-menu">
    <a class="dropdown-item" href="#">Item</a>
    <a class="dropdown-item" href="#">Another Item</a>
    <a class="dropdown-item" href="#">One more item</a>
    <div class="dropdown-divider"></div>
    <a class="dropdown-item" href="#">Separated link</a>
  </div>
</div>
      </div>
    </div>
  );
}

export default Jumbotron;
